# Creating Table structure Consolidate, Education, literacy, employment, district
# area, agegroup

DROP SCHEMA IF EXISTS sqlproj;

CREATE SCHEMA sqlproj;

USE sqlproj;

CREATE TABLE consolidate1(
Ecode INTEGER NOT NULL,
EduCode VARCHAR(50),
District_code INTEGER,
Area_code VARCHAR(50),
Age_Group_Code INTEGER,
Bsecondary_male INTEGER,
Bsecondary_Female INTEGER,
Below_Grad_Male INTEGER,
Below_Grad_Female INTEGER,
Tech_diploma_Male INTEGER,
Tech_diploma_Female INTEGER,
Grad_and_Above_Male INTEGER,
Grad_and_Above_Female INTEGER,
Tech_Deg_Male INTEGER,
Tech_Deg_Female INTEGER,
Edu_Male_Lit INTEGER,
Edu_Female_Lit INTEGER,
Edu_Male_ILit INTEGER,
Edu_Female_ILit INTEGER,
EMP_Male INTEGER,
EMP_Female INTEGER,
 PRIMARY KEY (Ecode)
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
 SELECT * FROM consolidate1;
 
 # creating education table
 

 CREATE TABLE education (
Ecode INTEGER NOT NULL,
EduCode VARCHAR(50),
District_code INTEGER,
Area_code varchar(50),
Age_Group_Code INTEGER,
Bsecondary_male INTEGER,
Bsecondary_Female INTEGER,
Below_Grad_Male INTEGER,
Below_Grad_Female INTEGER,
Tech_diploma_Male INTEGER,
Tech_diploma_Female INTEGER,
Grad_and_Above_Male INTEGER,
Grad_and_Above_Female INTEGER,
Tech_Deg_Male INTEGER,
Tech_Deg_Female INTEGER,
 PRIMARY KEY (Ecode)
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;

 # creating literacy table
 
CREATE TABLE literacy (
EduCode VARCHAR(50),
District_code INTEGER,
Area_code VARCHAR(50),
Age_Group_Code INTEGER,
Edu_Male_Lit INTEGER,
Edu_Female_Lit INTEGER,
Edu_Male_ILit INTEGER,
Edu_Female_ILit INTEGER,

 PRIMARY KEY (EduCode)
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
 # creating Employment table
 
 CREATE TABLE Employment(
EmpCode INTEGER NOT NULL,
District_code INTEGER,
Area_code VARCHAR(50),
Age_Group_Code INTEGER,
EMP_Male INTEGER,
EMP_Female INTEGER,
 PRIMARY KEY (EmpCode)
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 

  # creating Table District
  
  CREATE TABLE district(
District_code INTEGER,
Area_Name VARCHAR(50),

 PRIMARY KEY (District_code)
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
   # creating Table Area
   
CREATE TABLE area (
Area_code VARCHAR(3),
Area VARCHAR(10),

PRIMARY KEY (Area_code)
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
# creating Table age_group
   
CREATE TABLE Agroup (
Group_code INTEGER,
Age_group VARCHAR(50),

PRIMARY KEY (Group_code)
 )ENGINE=InnoDB DEFAULT CHARSET=utf8;
 
 
